import React, { useState, useEffect } from 'react';
import './styles.css';
import TeamSprite from './TeamSprite/index'


function TeamListing(props) {

  return (
    <div className="select-wrapper">
        <h3>{props.name}</h3>
        <div className="team-container">
            <TeamSprite index={props.team.team[0]} />
            <TeamSprite index={props.team.team[1]} />
            <TeamSprite index={props.team.team[2]} />
            <TeamSprite index={props.team.team[3]} />
            <TeamSprite index={props.team.team[4]} />
            <TeamSprite index={props.team.team[5]} />
        </div>
        <button>Edit</button>
        <button>Delete</button>
    </div>
  );
}

export default TeamListing;
